import React, { useState, useEffect } from "react";
import axios from "axios";

function LocalInspectionReports() {
  const [reports, setReports] = useState([]);

  useEffect(() => {
    async function fetchReports() {
      try {
        const response = await axios.get(
          "http://localhost:5000/local-inspections/",
          {
            withCredentials: true,
          }
        );
        setReports(response.data);
      } catch (error) {
        console.error("Fetch error:", error);
      }
    }

    fetchReports();
  }, []);

  return (
    <div>
      <h1>Latest Reports</h1>
      <table>
        <thead>
          <tr>
            <th>Report ID</th>
            <th>Vehicle Tag</th>
            <th>Year/Make/Model</th>
            <th>Employee Entry</th>
            <th>Entry Date</th>
            <th>Mileage</th>
            <th>Person Releasing</th>
            <th>Body of Vehicle</th>
            <th>Tires Condition and Air Pressure</th>
            <th>Horn</th>
            <th>State Inspection and License Sticker</th>
            <th>Wipers Reservoir</th>
            <th>Low and High Beam</th>
            <th>Brake Lights</th>
            <th>Turn Signal Lights</th>
            <th>Emergency Flasher Lights</th>
            <th>Vehicle Insurance Card Valid</th>
            <th>Gas Tank Full</th>
            <th>Emergency Instructions</th>
            <th>Wash Vehicle</th>
            <th>Comments</th>
            <th>DPW Signature</th>
          </tr>
        </thead>
        <tbody>
          {reports.map((report) => (
            <tr key={report.id}>
              <td>{report.id}</td>
              <td>{report.tag}</td>
              <td>{report.mileage}</td>
              <td>{report.workTicket}</td>
              <td>{report.personReleasingVehicle}</td>
              <td>{report.bodyOfVehicle}</td>
              <td>{report.tiresConditionAndAirPressure}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
              <td>{report.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default LocalInspectionReports;
